    return (
        <Slider
            sx={{
                color: '#007FFF',
                height: 8,
                '& .MuiSlider-rail': {
                    backgroundColor: '#d3d3d3',
                    opacity: 0.5,
                },
                '& .MuiSlider-thumb': {
                    backgroundColor: '#ff4081',
                    width: 20,
                    height: 20,
                },
            }}
            {...props} // передаем все пропсы, включая value и onChange
        />
    )
}

